I was chatting about this with [~bkietz], and tried out his suggestion to disable doxygen for all the kTypeName declarations, like:

{code}
  /// \cond false
  constexpr static char const kTypeName[] = "VarianceOptions";
  /// \endcond
{code}

This seems to fix the warning, and simply removed the kTypeName value from the documentation (which I assume is fine).
